import './App.css';

import TypeWriter from 'typewriter-effect'

const greetingTitles = [
  "Hey",
  "Salam",
  "Hej",
  "Hola!",
  "Din Mamma",
  "Bonjour!"
];

const getRandomGreetingTitle = () => {
  return greetingTitles[Math.floor(Math.random() * greetingTitles.length)];
};



function Heading2() {
  
  return (
  <div className='tracking-wider font-mono text-white text-9xl text-center'> 
      <TypeWriter
        onAnimationEnd = {() => console.log("Finito")
        }
        options={{
          loop: true,

        }}
        onInit={(typewriter) => {
          typewriter.pauseFor(3000).typeString({getRandomGreetingTitle}).start().deleteAll(100)
        }}
      />
  </div>
  );
}

export default Heading2;
